import React from "react";

class AddUser extends React.Component {
    render() {
    return (
        <header>
            <form>
                <input placeholder="Имя" className="form-control" />
                <input placeholder="Фамилия" className="form-control" />
                <textarea placeholder="Биография" className="form-control" />
                <input placeholder="Возраст" className="form-control" />
                <label htmlFor="isHappy" className="form-check-label">Погода</label>
                <input type="checkbox" id="isHappy" className="form-check-input" />
                <button type="button" className="btn btn-success">Создать пользователя</button>
            </form>
        </header>
    )
  }
  }

  export default AddUser
